import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h2 className="logo">Tarif Kapıda</h2>
      <input
        type="text"
        placeholder="Tarif ara..."
        className="search-input"
      />
      <div className="nav-links">
        <button>Kategoriler</button>
        <button>Giriş</button>
      </div>
    </nav>
  );
};

export default Navbar;
